import React from 'react';
import {Fragment} from 'react';
import Heading from './Heading';
import Para from './Para';
import List from './List.js';

function APP(){
    return(
        <Fragment>
            <Heading/>
            <Para/>
            <List/>
        </Fragment>
    )
}

export default APP;
